import "./heroimg.css";

import React from 'react'
import desertrainfrog from "../assets/desertrainfrog.jpeg";
import { Link } from "react-router-dom";

const Heroimg = () => {
  return (
    <div className = "hero"> 
        <div className = "mask"> 
            <img className = "into-img" src = {desertrainfrog} alt = "desertrainfrog" />
        </div>
        <div className = "content">
            <p> Hi what's up </p>
            <h1> Jennifer Cao </h1>
            <div>
                <Link></Link>
            </div>
        </div>
    </div>
  )
}

export default Heroimg;
